<html lang="en">

<head>
    <title>Email Template</title>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link
        href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap"
        rel="stylesheet">
    <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css" rel="stylesheet" />
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: "Poppins", sans-serif;
        }

        html,
        body {
            width: 100%;
        }

        .body {
            width: 100%;
            width: 100%;
            background: #f3f8fb;
            padding: 2rem 0;
        }

        .content {
            max-width: 70%;
            margin: auto;
            background: white;
            border-radius: 12px;
            overflow: hidden;
        }

        .header {
            background: linear-gradient(44.43deg, #3E4EB0 -20.27%, #164E47 105%);
            text-align: center;
            padding: 0.7rem 1rem;
        }

        .imgShows {
            text-align: center;
            padding: 2rem 0 1rem;
        }


        @media (min-width: 375px) {
            .imgShows svg {
                width: 250px;
                height: 100px;
            }
        }

        @media (max-width: 374px) {
            .imgShows svg {
                width: 250px;
                height: 190px;
            }
        }

        .welNote h4 {
            font-size: 32px;
            text-align: center;
            max-width: 70%;
            margin: auto;
        }

        hr {
            margin: 16px auto;
            max-width: 90%;
        }

        .msg {
            padding: 15px;
            padding-top: 0;
        }

        .msg p {
            font-size: 16px;
            margin-bottom: 16px;
        }

        .primary-btn {
            padding: 1rem 5rem;
            border: 10px solid;
            border-image-slice: 1;
            border-width: 5px;
            background: linear-gradient(44.43deg, #3E4EB0 -20.27%, #164E47 105%);
            border-image-source: linear-gradient(44.43deg, #3E4EB0 -20.27%, #164E47 105%);
            color: white;
            font-size: 16px;
            font-weight: bold;
            cursor: pointer;
        }

        .primary-btn:hover {
            background: #121FCF;
            background: linear-gradient(44.43deg, #3E4EB0 -20.27%, #164E47 105%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
        }

        .social-link {
            display: flex;
            align-items: center;
            gap: 1rem;
        }

        .social-link a svg {
            width: 24px;
            height: 24px;
            color: black;
        }

        .social-link a svg:hover {
            color: #121FCF;
        }

        .disclose span:nth-child(1) {
            font-size: 14px;
        }

        .disclose span:nth-child(2) {
            font-size: 12px;
            color: #797979;
            line-height: 24px;
        }

        @media (max-width:576px) {
            .content {
                max-width: 90%;
            }
        }

        @media (max-width:480px) {
            .welNote h4 {
                font-size: 16px;
                text-align: center;
                max-width: 90%;
                margin: auto;
            }

            .msg p {
                font-size: 12px;
            }

            .primary-btn {
                padding: 0.7rem 1rem;
                width: 85%;
                font-size: 12px;
            }
        }
    </style>
</head>

